import StatusComponent from "./StatusComponent";

function NavBar({ stepProp, setStepProp, onNext, onPrev }) {
  return (
    <div className="navBar">
      <StatusComponent>
        stepProp = {stepProp}
        setStepProp = {setStepProp}
      </StatusComponent>
    </div>
  );
}

export default NavBar;
